float* Radix_1_ac_float(float *A, size_t N, int *Tmp2){

    int Z1[256] ;
    int Z2[256] ;
    int Z3[256] ;
    int Z4[256] ;
    memset(Z1, 0, 256*sizeof(int)) ;
    memset(Z2, 0, 256*sizeof(int)) ;
    memset(Z3, 0, 256*sizeof(int)) ;
    memset(Z4, 0, 256*sizeof(int)) ;
    int Jump, Jump2, Jump3, Jump4 ;

    int * Aa = (int *)A ;
    // Short-circuit set-up
    Jump = (*Aa) & 255 ;
    Z1[Jump] = 1 ;
    Jump2 = (*Aa >> 8) & 255 ;
    Z2[Jump2] = 1 ;
    Jump3 = (*Aa >> 16) & 255 ;
    Z3[Jump3] = 1 ;
    Jump4 = (*Aa >> 24) & 255 ;
    Z4[Jump4] = 1 ;

    // Frequency distribution creation...try walking this backwards/forwards
    int * swp ;
    int * b = Aa + N ;
    for( ; --b != Aa ; )
    {
        ++Z1[(*b) & 255] ;
        ++Z2[(*b >> 8) & 255] ;
        ++Z3[(*b >> 16) & 255] ;
        ++Z4[(*b >> 24) & 255] ;
    }

    // 1st LSB byte sort
    if( Z1[Jump] == N ) ;
    else
    {
        swp = Z1 + 256 ;
        for( b = Z1 ; ++b != swp ; )
        {
            *b = *(b-1) + *b ;
        }
        for( b = Aa + N ; b-- != Aa ; )
        {
            *(--Z1[(*b) & 255] + Tmp2) = *b ;
        }
        Aa = Tmp2 ;
        Tmp2 = b ;
    }

    // 2nd LSB byte sort
    if( Z2[Jump2] == N ) ;
    else
    {
        swp = Z2 + 256 ;
        for( b = Z2 ; ++b != swp ; )
        {
            *b = *(b-1) + *b ;
        }
        for( b = Aa + N ; b-- != Aa ; )
        {
            *(--Z2[(*b >> 8) & 255] + Tmp2) = *b ;
        }
        Aa = Tmp2 ;
        Tmp2 = b ;
    }

    // 3rd LSB byte sort
    if( Z3[Jump3] == N ) ;
    else
    {
        swp = Z3 + 256 ;
        for( b = Z3 ; ++b != swp ; )
        {
            *b = *(b-1) + *b ;
        }
        for( b = Aa + N ; b-- != Aa ; )
        {
            *(--Z3[(*b >> 16) & 255] + Tmp2) = *b ;
        }
        Aa = Tmp2 ;
        Tmp2 = b ;
    }

    // 4th LSB byte sort and -ve numbers sort
    if( Z4[Jump4] == N ) ;
    else
    {
        swp = Z4 + 127 ;
        for( b = Z4 + 255 ; --b != swp ; )
        {
            *b = *(b+1) + *b ;
        }
        swp = Z4 + 128 ;
        *Z4 = *Z4 + *swp ;
        for( b = Z4 ; ++b != swp ; )
        {
            *b = *(b-1) + *b ;
        }
        for( b = Aa + N ; b-- != Aa ; )
        {
            // Getting back original -ve values
            *(--Z4[(*b >> 24) & 255] + Tmp2) = *b ;
        }
        return (float *)Tmp2 ;
    }

    return (float *)Aa ;
}
